/* 1. expressモジュールをロードし、インスタンス化してappに代入。*/
var express = require("express");
var app = express();
const vision = require('@google-cloud/vision');
const fs = require('fs');
const execute =  async () => {
    const client = new vision.ImageAnnotatorClient();
    const data = 'data:image/jpeg;base64,'
    const request = {
        image: {
            content: data,
        },
        imageContext: {
            languageHints: ['en-t-i0-handwrit'],
        },
    };
    // const [result] =  client.documentTextDetection(request)
    const [result]  = await client.textDetection(JSON.stringify(request)).then()
    // console.log(result)
    // const fullTextAnnotation = result.fullTextAnnotation;
    // console.log(`Full text: ${fullTextAnnotation.text}`);
}


/* 2. listen()メソッドを実行して3011番ポートで待ち受け。*/
var server = app.listen(3011, function(){
    console.log("Node.js is listening to PORT:" + server.address().port);
});

app.get("/:filename", function(req, res, next){
    const filename = req.params.filename
    execute()
    res.json();
});